import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App bg-dark h-100">
        <img src={logo} className="App-logo" alt="logo" />
    </div>
  );
}

export default App;
